import {  CourseNormalPart, CourseProjectPart, CourseSubmissionPart} from "../types";
import Part from "./Part";

const Content = ({courseParts}: {courseParts: Array<CourseNormalPart | CourseSubmissionPart | CourseProjectPart >}) => {
    return(
        <>
        {
            courseParts.forEach( part => {
                <div><b>{part.name} {part.exerciseCount}</b></div>
                switch (part.type) {
                    case 'normal':
                        <Part course={part}  />
                        break;
                    case 'groupProject':
                        <Part course={part}  />
                        break;
                    case 'submission':
                        <Part course={part}  />
                        break;
                    default:
                        break;
                }
            }

            )
        }
        </>
    )
}

export default Content;
